const http = require("http");
const url = require("url");
const querystring = require("querystring");
const fs = require("fs");

const port = 3000;

const server = http.createServer((req, res) => {
  const { pathname, query } = url.parse(req.url);

  if (req.method === "POST") {
    let body = "";
    req.on("data", (chunk) => {
      body += chunk.toString();
    });
    req.on("end", () => {
      const postData = querystring.parse(body);
      if (pathname === "/calculate-imc") {
        const peso = postData.peso;
        const altura = postData.altura;
        const imc = peso / (altura * altura);

        fs.appendFile(
          "imc_logs.txt",
          `Peso: ${peso} Altura: ${altura} IMC: ${imc}\n`,
          (err) => {
            if (err) throw err;
            console.log("IMC guardado en el archivo.");
          }
        );

        res.writeHead(200, { "Content-Type": "text/html" });
        res.end(`
          <p> Tu IMC es de: ${imc} </p>
          <a href="/imc-calculator"> Atras </a>
        `);
      }
    });
  } else if (req.method === "GET") {
    if (pathname === "/") {
      res.writeHead(200, { "Content-Type": "text/html" });
      res.end(`
        <ul>
          <li> <a href="/imc-calculator"> Calculadora de IMC </li>
          <li> <a href="/gallery"> Galeria </li>
          <li> <a href="/references"> Referencias </li>
        <ul>
      `);
    } else if (pathname === "/imc-calculator") {
      res.writeHead(200, { "Content-Type": "text/html" });
      res.end(`
        <form action="/calculate-imc" method="post">
          <label for="peso">Ingresa tu peso en kilogramos:</label>
          <input type="text" id="peso" name="peso">
          <label for="altura">Ingresa tu altura en metros:</label>
          <input type="text" id="altura" name="altura">
          <button type="submit">Calcular IMC</button>
        </form>
        <a href="/"> Atras <a>
      `);
    } else if (pathname === "/gallery") {
      res.writeHead(200, { "Content-Type": "text/html" });
      res.end(`
        <img src="data:image/jpeg;base64," alt="Gato Pardo" />
        <img src="data:image/jpeg;base64," alt="Gato Siames" />
        <img src="data:image/jpeg;base64," alt="Canasta con gatitos" />
        <a href="/"> Atras </a>
      `);
    } else if (pathname === "/references") {
      res.writeHead(200, { "Content-Type": "text/html" });
      res.end(`
        <ul>
          <li> <a href="https://nodejs.org/en/learn/asynchronous-work/event-loop-timers-and-nexttick"> The Node.js Event Loop </a> </li>
          <li> <a href="https://nodejs.org/en/learn/modules/anatomy-of-an-http-transaction"> Anatomy of an HTTP Transaction </a> </li>
          <li> <a href="https://nodejs.org/dist/latest-v14.x/docs/api/http.html#http_http"> Documentación del módulo HTTP de Node.js </a> </li>
          <li> <a href="https://www.npmjs.com/package/nodemon"> Nodemon </a> </li>
          <li> <a href="/"> Atras </a> </li>
        </ul>
      `);
    } else {
      res.writeHead(404, { "Content-Type": "text/html" });
      res.end(`
      <h1> Algo salio mal: 404 </h1>
      `);
    }
  }
});

server.listen(port, () => {
  console.log(`Server running in port: ${port}`);
});
